I've changed up how I style my hair a bit and wanted to share what products I've been using ✨️ 

Products:
@amika thermal brush & autopilot curling iron - Since summer ended, I've been into having my hair look more polished than normally, and these tools together have been helping me achieve a neater blowout look.

@biolage all-in-one multi-benefit oil - I'm super picky with my hair oils and this one meets my standards of not being too light or too thick.

@evolvh smart volume leave-in conditioner - This leave-in is top tier and not talked/or hyped up about enough and I don't understand why since it hydrates without weighing down hair - perfection imo.

@jvnhair compete air dry cream & pre-wash scalp oil - The air dry cream is a runner-up in being just as amazing at the shea moisture style milk and since I've been running out of that one it's been great to my mane. I leave the pre-wash oil on 15-30 minutes before I actually wash my hair and in the month I've been using it, I've noticed the baby hairs (aka. breakage) to be better tamed.

@sheamoistureca curl & style milk - I've been using this for YEARS and it's never let my wavy/curly hair down as it helps cut down airdrying time and doesn't make my hair lose volume.

@gisou honey infused hair perfume - I'm still not the biggest fan of this scent, but I do feel it helps with making my hair shiny and healthier looking.
