Late per usual on sharing some pr I've received, but the good news is I've used most of these by now to give a mini review! 

@goodmolecules sheer mineral sunscreen spf 30 - I've been doing pretty terrible with remembering to apply spf in the winter (toronto did experience 22 days without sunlight so it just flew by me) so I need to use this more than I should. I do however like the texture of it.

@kayali vanilla royale - This to date might be my favourite of their releases by far. It's a very luxurious and rich vanilla fragrance. It's pretty intense at first, but once it dries down, it's a sweet and yummy yet sophisticated scent on my skin.

@dove intensive repair shampoo & conditioner - I'm almost finished with this set and I really liked how it cleaned and hydrated my hair without weighing it down or looking limp in any way. I have other shampoos to try out after but if I ever ran out, I wouldn't mind repurchasing this set.

@lauramercier holiday sets - I think laura mercier always has the best holiday sets. I own a few of them already so I decided to give some of these away during the holidays to other makeup lovers that I knew!

@velourbeautyofficial lashes - Since becoming an affiliate, I've been loving to try out more of their lash styles. 'Last next door' has been my go-to for a more glam yet very natural look. Btw, I have a link to shop with me for a discount on my highlights.

I haven't received book pr in a long time so this was a nice surprise! I love the self-love planner and have especially been using the manifestation journal since I got it. It's been helping me stay motivated for the new year.

@elobaraheatlesshaircurler - I'm still experimenting with this since I'm new to this way of styling your hair overnight. I'll most likely do an update on this tool once I get a better gauge on it.
.
.
.
.
