I found a haircare and styling routine that's been working for me at the moment.

Products:
@amika water sign hydrating hair oil* - one of the best lightweight hair oils I've tried in a while that are still really hydrating.

@evolvh smart volume leave-in conditioner* - this is my second bottle and I can't get enough! I believe it can give any hairtype the lust it needs when it comes to volume.

@kerastase_official serum chroma thermique* - this combats frizz really well, but the biggest test for it will be on rainy or humid days, which I haven't been able to try out yet since we're still having winter weather.

@colorwowhair dream coat for curly hair - I always air-dry my hair at least 80% before I go in with any styling tools, and although I've tried this out only once I have to say I'm impressed with how my hair looks and feels. Again, I'll need to try this out more when the weather gets warmer.

@jvnhair complete air dry cream* - this helps cut air-drying time for my hair and keeps my natural texture as well.

amika hair fragrance* - my hair loves to pick up that annoying "outdoors scent" and what I've found is hair perfumes to be my saving grace. Love this smell of this this one.

*gifted items

