It finally feels like spring (!!) which means it's going to quickly become summer since inbetween seasons don't last long in Toronto (the forecast says it's expected to be 25°c this week). In the meantime, I've been wanting to explore my city again. I usually get into this mindset every now and then to feel inspired and appreciative of my surroundings. I'm so lucky to be here in such a diverse city! I will say the thrift stores lack at times, but at least the food options and culture are amazing. Beginning of March, the birthdays/holidays start to pile on until August, so there's going to be celebrations and dinners going on from now. My 'puppy' Chips is entering her teenage phase. She's been biting and I'm trying all tactics to get it under control so she doesn't end up a delinquent. Love her but she really makes me consider not having kids if it's this much work lol. Btw, I was doing some spring cleaning and found these film camera photos of my sister and I taken in 2011! I was literally a struggling photographer at the time, but on my downtime I loved doing these fun pointless photoshoots that just made me happy. 

Oh, and the products I've been using lately now that the sun's out 😎:
