The @sephoracanada sale starts tomorrow for rouge members so thought I'd share my makeup favourites. 

@charlottetilbury flawless foundation - hands down the best foundation imo. I personally prefer a satin finish since I have oily skin. It covers all redness and imperfections.

@rarebeauty liquid touch brightening concealer - if I'm honest, I don't wear concealer unless it's for a special occasion, or if I need to cover up spots. This one's full coverage and goes unnoticed.

@lauramercier talc-free translucent setting powder - love the fact that they came out with a talc-free version! I think this new formula is better than the og too.

@anastasiabeverlyhills ombre effect brow powder in dark brown

@makeupbymario soft sculpt shaping stick in medium - I love this contour. I do kinda wish it were more cool-toned.

charlotte tilbury beautiful skin sun-kissed glow cream bronzer - It's so easy to blend and just makes my skin look naturally sun-kissed!

@tower28beauty bronzino illuminating cream bronzer in west coast - I didn't expect to love this type of more creamy formula but I just love how flawless it makes my complexion look.

@merit day glow dewy highlighting balm in cava - I've gone back and forth with many highlighters, but I think this one's the best since it just makes me look dewy and fresh.

rare beauty soft pinch liquid blush in bliss - they're hyped up for a reason. I may need to pick up the new shades.

charlotte tilbury airbrush flawless setting spray

charlotte tilbury luxury eyeshadow palette - I love all their eyeshadow quads but if I has to choose just one, it's got to be exaggereyes. 

@lancomeofficial idôle waterproof mascara

charlotte tilbury lip cheat lip liner in iconic nude

@glossier ultralip lipstick in portrait - I really love the formula of these. If you buy anything from them, these are a must.

tower28 shineon lip jelly gloss in xoxo
