Lil review on some new products to my makeup collection:

@iliabeauty super serum skin tint spf 40* - I'm surprised with how much I love this skin tint! It does have a bit of a weird sunscreen scent, but goes away once it's applied and dried down. The finish is naturally beautiful and great for everyday. I know it's going to be perfect for summer.

@yslbeauty all hours foundation* - as someone with oily skin, I think this foundation would be amazing for special occasions where you want your makeup to really stay put. I don't see this being a favourite to those who like a very glowy/dewy finish or perhaps has drier skin though.

@summerfridays lip butter balm in pink sugar - I get the hype of this lip balm now. It's AMAZING. It did take some convincing from @sofiarichiegrainge to finally pull the plug but I'm happy I did. The formula is so comfortable and not sticky whatsoever. 

@narsissist afterglow laguna lip balm* - I haven't seen anyone talk about this one before, but I gotta say it's an underrated lip balm. It's pretty on it's own or as a topper on lipstick since it has shimmer and makes your lips look plump.

*gifted
