What I'm using in the shower 🫧 🚿 

@amika velveteen dream shampoo + conditioner* - this line by far is my favourite collection from amika! It works to well for my thick curly/very frizzy hair type. It really helps make my hair more manageable.

@kerastase_official chroma absolu masque* - love how well this hair mask works on my dry ends. It also makes my hair really shiny and soft. When I need a refresher, it's perfect, plus it smells absolutely amazing.

@dove body wash - this is definitely my tried and true. I will always have this in stock. It just gets the job done.

@naturiumskin the smoother glycolic acid body wash* - I've been using this for a month or so now and have noticed that bumps and marks on my legs have greatly faded. My skin has just been more healthy looking since using this.

@avene cleansing foam* - lots would say washing your face in the shower is a no-no but I'm a rebel and prefer it that way. Really love this cleanser as it's very suitable for acne-prone and sensitive skin like mine.
