Rating skincare products I've been using ☀️ 

Products:
@heimish_ca artless glow base spf 50 pa+++ - Love! This one can get too glowy if you're oily skin, but I usually powder and it's not an issue.

@drsambunting flawless body therapy - The drydown and how hydrating your skin looks after is amazing, but I dislike how much work it is to blend in.

@paulaschoice healthy glow invisible sunscreen oil spf 30 - This would be my go-to if I'm going to the beach. I think people with drier skin types would suit this more.

@naturiumskin bha liquid exfoliant 2% - Dare I say this is a dupe to another brands bha? 

@charlottetilburyskincare magic cream - Literally magic! I can't see me living without this. My skin looks and especially feels so nice since using it.

@theordinary glycolic acid 7% - I use it as deodorant in all places that need a refresher, including my armpits. Unfortunately, it doesn't stop you from sweating but is great at eliminating odor.

heimish all clean balm - I do prefer cleansing oils, but this cleansing balm has been doing amazing at removing my eye makeup quick.

@heimish_cosmetic matcha biome gel moisturizer - really adore this moisturizer at the moment! Skin's hydrated without being anymore oily.
