The fragrances I've been using the most recently. I'm annoyed that I left out the orris labs one I made on my birthday, which is insane to me because it's the one I use the most 🤦🏻‍♀️! It's the only perfume bottle I keep it on top of my dresser/vanity, but that's the reason why I missed it when filming even though it was right in front of my face 🙃. My brain was definitely somewhere else. 

Fragrances mentioned:

@kayali wedding velvet sandal 35 * - I wasn't sure if this could be a summer fragrance, but it definitely can be! It's a sultry yet sophisticated tonka/vanilla fragrance, with prominent sandalwood, and has an undertone of chocolatey-ness on my skin.

kayali wedding silk sandal 36 * - This is the perfect all year round perfume. It's very feminine floral with notes of champagne, may rose, and sugar and vanilla that stay the longest on me. The projection and sillage is strong so I go easy on this one.

@arianagrande mod vanilla - I was influenced by @thatfragrancegirl to pick this one up and it does not disappoint! This is the yummiest and most addictive vanilla fragrance I've ever encountered. I love the warmth of it and how it traits.

@nuxeca prodigieux * - Always and forever will remind me of European summer vacations. It has a lot of that sunscreen vibe but I love it for that. 

@tomfordbeauty soleil blanc - I know you're sick of me always showing this one, but it's my summer staple and it wouldn't be me without it. Very much screams summer and it always reminds me of July.

* gifted items 
