the products I've been reaching for the most recently this month.

@kayali Sparkling Lychee 39 + Vanilla 28* - these have been my combo since receiving it.

@armanibeauty Luminou Silk Hydrating Primer* - as an oily skin girly, I was scared this wouldn't work out for me, but I love how my makeup sits flawlessly with this under.

@milkmakeup Lip + Cheek Cream Blush in Werk* - I've been loving the combo of wearing both a powder and cream blush together, and this shade looks beautiful on top of whatever powder blush I'm using.

@revloncanada Skinlights Prismatic Bronzer in Sunkissed Beam - this ended up on my fyp and this is by far the best drugstore bronzer I've ever tried! It makes my skin look so luminous and just a touch sunkissed.

@charlottetilbury Lip Cheat Lip Liner in Supersize Me - their lip liners continue to be my favourite and this colour specifically was the one that got me into them. I haven't worn it in a very long time so I've revisited the shade and love it.

@rhode Peptide Lip Tint in Toast - this shade and Ribbon are the perfect everyday shades and keep my lips hydrated going into this colder weather.

@yslbeauty Candy Glaze in #15* - I've always been a matte or satin lips girl, but I'm loving more glossy looks this year. This is another one of those lippies that's worth carrying around with the million others in your purse.

@kyliecosmetics Blush Powder in Baddie On the Block - no matter how many times I try out new powder blushes, I always come back to Kylie's. This shade along with Winter Kissed are my go tos.

